const Profit_Loss = ({ company, indicator, rate, stopProfit, stopLoss }) => {

    return(
        <div className='profit-loss'>
            <p>{company}</p>
            <p>{indicator}</p>
            <p>{rate}</p>
            <p>{stopProfit}</p>
            <p>{stopLoss}</p>
        </div>
    )
}

export default Profit_Loss
